import React from "react";
import { Card, Image, Icon } from "semantic-ui-react";
function CustomCard({ src, title, date, time, description }) {
  return (
    <Card>
      <Image src={src} wrapped ui={false} />
      <Card.Content>
        <Card.Header>{title}</Card.Header>
        <Card.Meta>
          <span className="date">Did it in: {date}</span>
        </Card.Meta>
        <Card.Description>{description}</Card.Description>
      </Card.Content>
      <Card.Content extra>
        <a href="#test">
          <Icon name="time" />
          {time}
        </a>
      </Card.Content>
    </Card>
  );
}

export default CustomCard;
